        {
            title: "Travel Booking Site",
            description: "blah blah blah",
            imgUrl: 'Project.jpeg',
        },
    ];

    return (
        <div className="projects">
            <div className="projects-container">

            </div>
            My Projects
        </div>
    )
}

export default Project;
